(window.webpackJsonp=window.webpackJsonp||[]).push([[0],{"/JAH":function(e,t){var n=document.querySelector("input.js-switch-input"),i=document.querySelector("body"),a="light-theme",s="dark-theme";function c(e,t,i){e.classList.remove(t.currentTheme),e.classList.add(i),t.isChecked?n.removeAttribute("checked",""):n.setAttribute("checked",""),t.isChecked=!t.isChecked,t.currentTheme=i}themeStatus=localStorage.getItem("themeStatus")?JSON.parse(localStorage.getItem("themeStatus")):{currentTheme:null,isChecked:null},null!==themeStatus.currentTheme?(i.classList.add(themeStatus.currentTheme),themeStatus.isChecked&&n.setAttribute("checked","")):(i.classList.add(a),themeStatus.currentTheme=a,themeStatus.isChecked=!1,localStorage.setItem("themeStatus",JSON.stringify(themeStatus))),n.addEventListener("change",(function(){themeStatus.isChecked?c(i,themeStatus,a):c(i,themeStatus,s),localStorage.setItem("themeStatus",JSON.stringify(themeStatus))}))},"4e4B":function(e,t,n){},QfWi:function(e,t,n){"use strict";n.r(t);n("4e4B");var i=n("xLVt"),a=n.n(i),s=n("dxDv"),c=document.querySelector(".js-menu"),r=a()(s);c.insertAdjacentHTML("beforeend",r);n("/JAH")},dxDv:function(e){e.exports=JSON.parse('[{"id":"XWaQXcbk0","name":"Картофель, запеченный в мундире","description":"Ароматный, сытный, шипящий домашний картофель, фаршированный сметанно-беконной начинкой, — это очень простой и очень эффектный способ накормить большое количество человек, практически не потратив на готовку ни сил, ни времени. Обычную картошку при желании тут можно заменить на сладкий батат, а в начинку добавить, к примеру, кукурузу или сладкий красный перец.","image":"https://s1.eda.ru/StaticContent/Photos/140812180013/140820212258/p_O.jpg","price":100,"ingredients":["Картофель","Чеснок","Сметана","Бекон","Твердый сыр","Зеленый лук"]},{"id":"pkXzyRp1P","name":"Томатный магрибский суп","description":"Томатный магрибский суп особенно распространен в Марокко и Тунисе. Он весьма прост в приготовлении и сам по себе легкий — в основе томаты и куриный бульон. Кроме них в супе только необходимые специи, мед и лимон, которые все вместе и передают тот самый восточный колорит. Вкус супа всецело зависит от качества томатов. Дополнят блюдо свежая кинза и отдельные дольки лимона.","image":"https://www.go-cook.ru/wp-content/uploads/2014/11/magribskij-tomatnyj-sup.jpg","price":150,"ingredients":["Помидоры","Куриный бульон","Мед","Петрушка","Кинза","Паприка"]},{"id":"QMom9q4Ku","name":"Крем-суп из тыквы","description":"Портрет этой оранжевой похлебки украшает обложку книги «La Cuisine du Marché» Поля Бокюза. Бокюз, придумавший так называемую новую кухню, считал тыкву одной из основ этого миропорядка, а тыквенный суп — эдакой околоплодной водой гастрономии.","image":"https://s1.eda.ru/StaticContent/Photos/121114213720/151024152626/p_O.png","price":100,"ingredients":["Тыква","Петрушка","Сливки","Бренди","Куриный бульон"]},{"id":"k2k0UrjZG","name":"Салат из красной фасоли с творожным сыром","description":"Тосканский салат, выдержанный в колористике итальянского флага. Буквально нескольких ложек хватает, чтобы в желудке образовалась приятная тяжесть. Очень полезная штука с точки зрения утра, когда трудно запихнуть в себя крупные дозы биомассы, а есть при этом хочется.","image":"https://s.mediasole.ru/cache/content/data/images/1393/1393226/original.jpg","price":150,"ingredients":["Фасоль","Соль","Чеснок","Оливковое масло","Творожный сыр","Красный лук"]},{"id":"j2k8U1jZd","name":"Классический греческий салат ","description":"Это рецепт из старой, привезенной из Греции, кулинарной книги. Секрет салата — свежайшие овощи и хорошая фета. Для салата используют только оливковое масло, а такие специи, как орегано и базилик, являются визитной карточкой греческой кухни.","image":"https://dietdo.ru/wp-content/uploads/2017/03/Grecheskiy-salat-retsept-klassicheskiy-s-foto-poshagovo-min.jpg","price":350,"ingredients":["Оливковое масло","Лимонный сок","Чеснок","Помидоры","Красный лук","Сыр фета","Маслины"]},{"id":"X2aQ7cvkd","name":"Маффины с голубикой и мускатным орехом","description":"Культовая ягода, которую научились производить круглый год, в сочетании с рыхлым тестом — это абсолютно беспроигрышный вариант. Маффины с голубикой стали популярным десертом в Англии и Америке, хотя происхождение их французское. Да и вообще эти маленькие сладкие кексы, какими мы их знаем сейчас, задумывались как обычный хлеб и на вкус были нейтральны.","image":"https://s1.eda.ru/StaticContent/Photos/120131111301/140324110953/p_O.jpg","price":170,"ingredients":["Сливочное масло","Пшеничная мука","Голубика","Ванильный экстракт","Мускатный орех"]},{"id":"nk3zy1pf8","name":"Азу по‑татарски","description":"Одно из немногих блюд, удостоившихся в советской продуктовой традиции продажи с именной нарезкой. И до сих пор в кулинариях и супермаркетах можно найти говядину, которую режут соломкой и продают как азу. Насчет самого блюда до сих пор идут споры, как и с чем готовить: использовать говядину или баранину, топленое или обычное масло, тушить в казане или сотейнике с толстым дном. Редакций этого блюда может быть много, но основа его всегда неизменна — это нарезанное соломкой мясо, картофель и томатный соус.","image":"https://s2.eda.ru/StaticContent/Photos/160105153525/160110193232/p_O.jpg","price":270,"ingredients":["Говядина","Соленые огурцы","Картофель","Мясной бульон","Чеснок"]},{"id":"b7k2U13fd","name":"Жареный рис с яйцом по‑китайски","description":"Жареный рис — довольно распространенный ингредиент блюд восточноазиатской кухни — готовить, в сущности, можно из остатков вчерашнего ужина. Только хорошо остывший, заранее сваренный рис, в идеале простоявший всю ночь в холодильнике, при попадании в раскаленный вок не расползется до состояния каши и не превратит содержимое сковородки в неповоротливый бесформенный ком.","image":"https://s2.eda.ru/StaticContent/Photos/150428090447/150505141508/p_O.jpg","price":240,"ingredients":["Круглый рис","Мини цукини","Тертый имбирь","Грибы шиитаке","Соевый соус","Кунжутное масло"]}]')},xLVt:function(e,t,n){var i=n("mp5j");e.exports=(i.default||i).template({1:function(e,t,n,i,a){var s,c=e.lambda,r=e.escapeExpression,o=e.lookupProperty||function(e,t){if(Object.prototype.hasOwnProperty.call(e,t))return e[t]};return'<li class="menu__item">\n  <div class="card">\n    <img\n      src="'+r(c(null!=t?o(t,"image"):t,t))+'"\n      alt="Картофель, запеченный в мундире"\n      class="card__image"\n    />\n    <div class="card__content">\n      <h2 class="card__name">'+r(c(null!=t?o(t,"name"):t,t))+'</h2>\n      <p class="card__price">\n        <i class="material-icons">\n          monetization_on\n        </i>\n        '+r(c(null!=t?o(t,"price"):t,t))+' кредитов\n      </p>\n\n      <p class="card__descr">'+r(c(null!=t?o(t,"description"):t,t))+'</p>\n\n      <ul class="tag-list">\n'+(null!=(s=o(n,"each").call(null!=t?t:e.nullContext||{},null!=t?o(t,"ingredients"):t,{name:"each",hash:{},fn:e.program(2,a,0),inverse:e.noop,data:a,loc:{start:{line:21,column:8},end:{line:23,column:17}}}))?s:"")+'      </ul>\n    </div>\n\n    <button class="card__button button">\n      <i class="material-icons button__icon">\n        shopping_cart\n      </i>\n      В корзину\n    </button>\n  </div>\n</li>\n'},2:function(e,t,n,i,a){return'        <li class="tag-list__item">'+e.escapeExpression(e.lambda(t,t))+"</li>\n"},compiler:[8,">= 4.3.0"],main:function(e,t,n,i,a){var s;return(null!=(s=(e.lookupProperty||function(e,t){if(Object.prototype.hasOwnProperty.call(e,t))return e[t]})(n,"each").call(null!=t?t:e.nullContext||{},t,{name:"each",hash:{},fn:e.program(1,a,0),inverse:e.noop,data:a,loc:{start:{line:1,column:0},end:{line:35,column:9}}}))?s:"")+"\n"},useData:!0})}},[["QfWi",1,2]]]);
